import { NgModule,NgForm } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { FormsModule }   from '@angular/forms';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { PersonalComponent } from './componentes/personal/personal.component';
import { EnderecoComponent } from './componentes/endereco/endereco.component';
import { ConfirmComponent } from './componentes/confirm/confirm.component';

@NgModule({
  declarations: [
    AppComponent,
    PersonalComponent,
    EnderecoComponent,
    ConfirmComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
